description:
Укрпошта 2.0 — новий мобільний застосунок для трекінгу та відправки посилок в Україні та за кордон.
Відстежуйте всі свої відправлення автоматично за номером телефону та створюйте нові відправки в кілька кліків. Ми зібрали ключові функції, щоб зробити роботу з посилками максимально швидкою та зручною.
У новій версії застосунку доступні:
- трекінг посилок — усі ваші відправлення з’являються автоматично, без потреби вводити трек-номери;
- створення відправлень — формуйте накладні прямо в застосунку: по Україні та за кордон;
- гнучкість і простота — створюйте посилки та міжнародні відправлення з доставкою у відділення або на адресу.


Ми продовжуємо працювати над застосунком, додавати нові функції та покращувати інтерфейс. Але вже зараз встановіть та протестуйте ключовий функціонал. Поділіться відгуками — саме завдяки вам ми зробимо Укрпошту ще зручнішою.
Чому варто спробувати «Укрпошта 2.0» вже сьогодні:
- швидкий доступ до всіх відправлень;
- створення посилок без черг та паперових бланків;
- сучасний інтерфейс та регулярні оновлення;
- можливість впливати на розвиток застосунку своїм фідбеком.


Станьте серед перших користувачів нового мобільного застосунку Укрпошти. Завантажуйте «Укрпошта 2.0», користуйтесь, надсилайте відгуки — і допомагайте нам зробити сервіс ще кращим.

Оновлений застосунок YASNO допоможе швидко та зручно дізнатися суму до оплати за світло, передати показання, а також оплатити комуналку без комісії. У застосунку ви маєте доступ до особистого кабінету, ідентичного тому, який на сайті yasno.com.ua.

Завдяки оновленню у додатку YASNO можна:
- подати заявку на зміну постачальника е/е чи тарифу для бізнесу;
- проаналізувати споживання електроенергії чи газу за виставленими рахунками. Це допоможе зменшити споживання та витрати на комунальні послуги;
- налаштувати нагадування про передачу показань лічильників — це зручно;
- створити рахунки для декількох об'єктів та оплатити рахунки одним клацом;
- активувати програму лояльності та отримувати знижки на YASNO shop (магазин доступний і в застосунку) та пропозиції від партнерів.

Сформовані платіжки можна зберегти у PDF, переслати у месенджері або видрукувати.

Вакансії в Києві, Дніпрі, Одесі, Львові, Харкові, Запоріжжі та інших містах України — роботодавці вже зачекалися на ваші резюме.
Створюйте, редагуйте і відправляйте резюме або відгукуйтеся без нього, користуйтеся різноманітними фільтрами під час пошуку вакансій, дивіться статистику — в застосунку є все, щоб знайти роботу мрії.

Шукайте швидко і зручно серед більш ніж 50 тисяч вакансій. Знаходьте вакансії за ключовими словами або синонімами.

Використовуйте фільтри за:
• категоріями;
• містами;
• видом зайнятості;
• роботою для студентів;
• для людей з інвалідністю.

Сортуйте результат за:
• датою;
• зарплатою;
• віддаленістю від вашого місцезнаходження.

Відгукуйтеся найзручнішим чином:
• збереженим резюме;
• резюме з файлу;
• без резюме.

Створюйте, редагуйте та розміщуйте резюме прямо у застосунку. Керуйте налаштуваннями видимості резюме та персональних даних. Додатково вказуйте:
• досвід роботи;
• світлину;
• посилання на соціальні мережі;
• освіту;
• навички;
• знання мов;
• рекомендації;
• інвалідність;
• додаткову інформацію.

І це ще не все:
• слідкуйте за статистикою переглядів резюме;
• зберігайте вакансії, що сподобалися;
• стежте за своєю історією відгуків;
• переглядайте схожі вакансії;
• переглядайте всі вакансії однієї компанії;
• дивіться розташування майбутньої роботи на мапі.

